import './App.css';
import Navbar from './components/Navbar';
import { React, Fragment } from 'react';
import Header from './components/Header';
import Particles from 'react-particles-js';

const App = () => (
  <Fragment>
    <Particles 
    params={{
      particles:{
        number:{
          value:30,
          density:{
            enable:true,
          }
        }
      }
    }}/>
    <Navbar />
    <Header />
  </Fragment>
);

export default App;
